			          // Show an alert with the result
			          swal({
		              	title: "NOT deleted",
                        text: "There's been an error. Your item might not have been deleted.",
		              	icon: "error",
		              	timer: 4000,
		              	buttons: false,
		              });
			      }
			  });
			}
		});

